import React from 'react';

import NavigationButton from './../../components/NavigationButton.js'
import './About.css';

import profile from './../../assets/profile.png'

function About() {
  return (
      <div className="About">
          <div className="Image">
              <img className="Image-photo" src={profile} />
          </div>


      </div>
  );
}

export default About;
